import React from "react";
import classes from './LoginSignupButton.module.css';
import { Link } from "react-router-dom";

const LoginSignupButton = (props) => {
  return (
    <div className={classes['login-button-div']}>
      <button type='submit' className={classes['login-button']} onClick={props.onSubmit()}>
        <Link  className={classes['login-button-label']} onClick={props.onSubmit()}>
          Sign up
        </Link>
      </button>
    </div>
  );
};

export default LoginSignupButton;
